import React from 'react'
import MainSection from './MainSection'

class App extends React.Component{
    
    constructor(){
        super()
        this.state ={

            kameez :{
                kurta:true,
                sherwani:false,
                shirt:false,
            },

            kurtaShape:{
                roundKurta:false,
                squireKurta:true,
            },

            shirtShape:{
                halfSleaves:false,
                fullSleaves:true
            },

            kameezMeasurement:{
                height:40,
                shoulders:18,
                sleaves:23,
                chest:35,
                width:22,
            }, 

            collorStyle:{
                EnglishCollor:true,
                bainCollor:false
            },

            shalwarType:{
                paint:false,
                shalwar:true,
                trouser:false,
                patiala:true
            }


        }
    }

    render(){
        return(
            <div>
                <MainSection  state ={this.state} />

            </div>
        )
    }
}

export default App;
